import React, { Fragment } from "react";
import Link from "next/link";
import Navigation from "../components/navigation";

export default function _error() {
  return (
    <Fragment>
      <Navigation />
      <div
        style={{
          marginTop: "20rem",
          textAlign: "center",
        }}
      >
        <h1>The page does not exist</h1>
        <Link href="/">
          <a href="/">
            <style jsx>{`
              a {
                display: "inline-block";
                padding: ".7rem 1.3rem";
                font-size: "2.1rem";
                color: "#fff";
                background: "#6470FB";
                border-radius: "5px";
              }
            `}</style>
            Back to Home
          </a>
        </Link>
      </div>
    </Fragment>
  );
}
